import { Component } from '@angular/core';

@Component({
  selector: 'app-calculadora',
  templateUrl: './calculadora.component.html',
})
export class CalculadoraComponent {
  numerUno: number = 1;
  numeroDos: number = 1;

  result: number = 2;

  sumar():number {
    return this.numerUno + this.numeroDos;
  }
}
